package dsa.string;

public class ConvertStringToInteger {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s = "44";
		int i = Integer.parseInt(s);
		System.out.println(i);
		String s1 = "abc";
		int i1 = Integer.parseInt(s1);
		System.out.println(i1);
	}

}
